Un fourgon est un vhicule couvert servant au transport, comme :

    un fourgon routier, plus communment appel  camionnette  ou  fourgonnette  ;
    un fourgon blind, vhicule lourd blind servant au transport de fonds ;
    un fourgon funraire, ou corbillard, servant au transport des morts ;
    un fourgon pompe-tonne, un vhicule de pompier destin  la lutte contre les incendies ;
    un fourgon ferroviaire, un wagon de transport de marchandises.

Un fourgon dsigne galement un instrument servant  attiser le feu, genre tisonnier, servant  fourgonner.
